import logo from './logo.svg';
import './App.css';
import React, { useState, useEffect } from 'react';
const banana = require('@banana-dev/banana-dev');

function App() {
    const [count, setCount] = useState(0);
    const [images, setImages] = useState("");

    useEffect(() => {
      // update image list on page
      document.title = `You clicked ${count} times`;
    });

    const generateImage = async () => {
      // call banana
      const out = await banana.run("48e6f984-4f85-4b8a-a2aa-6ade981c129e", "cee3a79a-7983-4f39-9974-9fce016fc809", {"prompt": "Attack on titan donald trump"})
      const b64 = out.modelOutputs[0].image_base64;
      console.log(out)
      setImages([...images, b64]);
    }

    return (
      <div>
        <p>You clicked {count} times</p>
        <button onClick={generateImage}>
          Click me
        </button>
        {
          images.map((image) => {
            {image ? <img src={`data:image/png;base64,${image}`}/>: ''}
          })
        }
      </div>

    );
}

export default App;
